	'Language / Locale' => "Keel / Lokaal",
	'Choose a default language/locale for your b2evo installation.' => "Valige vaikimisi keel/lokaal oma b2evo installatsiooni jaoks.",
	'Check your database config settings below and update them if necessary...' => "Kontrollige oma andmebaasi konfiguratsiooni allpool ja uuendage seda, kui vaja...",
	'The minimum requirement for this version of b2evolution is %s version %s but you are trying to use version %s!' => "Käesoleva b2evolution versiooni miinimumnõudmine on %s versioon %s kuid teie üritate kasutada versiooni %s!",
	'It seems that the database config settings you entered don\'t work. Please check them carefully and try again...' => "Paistab, et teie poolt sisestatud andmebaasi seadistused ei tööta. Palun kontrollige neid hoolikalt ja proovige uuesti...",
	'Config file update' => "Konfiguratsioonifaili uuendus",
	'We cannot automatically update your config file [%s]!' => "Me ei saa teie konfiguratsioonifaili [%s] automaatselt uuendada!",
	'There are two ways to deal with this:' => "Seda saab teha kahte moodi:",
	'You can allow the installer to update the config file by changing its permissions:' => "Te saate lubada installeril konfifaili uuendada muutes tema ligipääsu:",
	'<code>chmod 666 %s</code>. If needed, see the <a %s>online manual about permissions</a>.' => "<code>chmod 666 %s</code>. Kui vaja, vaadake <a %s>online manual about permissions</a>.",
	'Come back to this page and refresh/reload.' => "Tulge tagasi sellele lehele ja refresh/reload.",
	'Alternatively, you can update the config file manually:' => "Alternatiivina võite uuendada konfifaili käsitsi:",
	'Open the _config.php file locally with a text editor.' => "Avage _config.php fail lokaalselt tekstiredaktoriga.",
	'Delete all contents!' => "Kustutage kogu sisu!",
	'Copy the contents from the box below.' => "Kopeerige sisu allolevast lahtrist.",
	'Paste them into your local text editor. <strong>ATTENTION: make sure there is ABSOLUTELY NO WHITESPACE after the final <code>?&gt;</code> in the file.</strong> Any space, tab, newline or blank line at the end of the conf file may prevent cookies from being set when you try to log in later.' => "Paste'ge see oma lokaalsesse tekstiredaktorisse. <strong>TÄHELEPANU: kontrollige, et EI OLEKS TÜHIKUT peale lõppu <code>?&gt;</code> failis.</strong> Ükskõik mis tühik, tab, uus rida või tühi rida võib takistada küpsiste saatmist kui te hiljem üritate sisse logida.",
	'Save the new _config.php file locally.' => "Salvestage uus _config.php fail lokaalselt.",
	'Upload the file to your server, into the /_conf folder.' => "Upload'ige ta oma serverisse /_conf kataloogi.",
	'<a %s>Call the installer from scratch</a>.' => "<a %s>Alusta installeerimist uuesti</a>.",
	'This is how your _config.php should look like:' => "Nii peaks teie _config.php välja nägema:",
	'Your configuration file [%s] has been successfully updated.' => "Teie konfiguratsioonifail [%s] on uuendatud.",
	'Base configuration' => "Põhikonfiguratsioon",
	'Your base config file has not been edited yet. You can do this by filling in the form below.' => "Teie põhikonfiguratsioonifaili ei ole veel muudetud. Te saate seda teha täites allpoolasuva vormi.",
	'This is the minimum info we need to set up b2evolution on this server:' => "See on miinimuminfo, mida me vajame, et installeerida b2evolution sellele serverile:",
	'Database you want to install into' => "Andmebaas, kuhu tahate installida",
	'mySQL Username' => "mySQL kasutajanimi",
	'Your username to access the database' => "Teie andmebaasi kasutajanimi",
	'mySQL Password' => "mySQL parool",
	'Your password to access the database' => "Teie andmebaasi parool",
	'mySQL Database' => "mySQL andmebaas",
	'Name of the database you want to use' => "Kasutatava andmebaasi nimi",
	'mySQL Host' => "mySQL host",
	'You probably won\'t have to change this' => "Seda ei pea te arvatavasti muutma",
	'Additional settings' => "Lisaseaded",
	'Base URL' => "Põhi-URL",
	'This is where b2evo and your blogs reside by default. CHECK THIS CAREFULLY or not much will work. If you want to test b2evolution on your local machine, in order for login cookies to work, you MUST use http://<strong>localhost</strong>/path... Do NOT use your machine\'s name!' => "See on koht, kus b2evo ja teie blog'id hakkavad vaikimisi olema. KONTROLLIGE SEDA HOOLIKALT või muidu enamus asju ei tööta. Kui te tahate testida b2evolution'i oma masinas, siis selleks, et küpsised töötaksid, te PEATE kasutama http://<strong>localhost</strong>/path... ÄRGE kasutage oma masina nime!",
	'Your email' => "Teie email",
	'Will be used in severe error messages so that users can contact you. You will also receive notifications for new user registrations.' => "Kasutatakse tõsiste serveri veateadete puhul, et kasutajad saaksid teiega kontakteeruda. Te saate ka teateid uute kasutajate registreerumisest.",
	'Update config file' => "Uuenda konfifaili",
	'How do you want to install b2evolution?' => "Kuidas te soovite b2evolution'i installida?",
	'The installation can be done in different ways. Choose one:' => "Installatsiooni võib teha mitmeti. Valige üks:",
	'<strong>New Install</strong>: Install b2evolution database tables with sample data.' => "<strong>Uus Install</strong>: Installeeri b2evolution andmebaasitabelid näidisandmetega.",
	'<strong>Upgrade from a previous version of b2evolution</strong>: Upgrade your b2evolution database tables in order to make them compatible with the current version!' => "<strong>Uuenda b2evolution'i eelmisest versioonist</strong>: Uuenda b2evolution andmebaasi tabeleid, et muuta need ühilduvateks käesoleva versiooniga!",
	'<strong>Upgrade from Cafelog/b2 v 0.6.x</strong>: Install b2evolution database tables and copy your existing Cafelog/b2 data into them.' => "<strong>Uuenda Cafelog/b2 v 0.6.x'ist</strong>: Installeeri b2evolution andmebaasitabelid ja kopeeri neisse olemasolevad Cafelog/b2 andmed.",
	'<strong>Upgrade from Manywhere Miniblog</strong>: Install b2evolution database tables and copy your existing Miniblog data into them.' => "<strong>Uuenda Manywhere Miniblog'ist</strong>: Installeeri b2evolution andmebaasi tabelid ja kopeeri olemasolevad andmed Miniblog'ist.",
	'<strong>Upgrade from WordPress v 1.2</strong>: Install b2evolution database tables and copy your existing WordPress data into them.' => "<strong>Uuenda WordPress v 1.2'st</strong>: Installeeri b2evolution andmebaasi tabelid ja kopeeri neisse olemasolevad WordPress andmed.",
	'Delete b2evolution tables' => "Kustuta b2evolution tabelid",
	'If you have installed b2evolution tables before and wish to start anew, you must delete the b2evolution tables before you can start a new installation. <strong>WARNING: All your b2evolution tables and data will be lost!!!</strong> Your Cafelog/b2 or any other tables though, if you have some, will not be touched in any way.' => "Kui te olete installeerinud b2evolution tabelid ennem ja soovite alustada uuesti, peate te b2evolution tabelid kustutama enne uue installatsiooni alustamist. <strong>ETTEVAATUST: Kõik teie b2evolution tabelid ja andmed kaovad!!!</strong> Teie Cafelog/b2 või ükskõik mis teised tabelid, kui teil on mõned, jäävad puutumata.",
	'<strong>Change your base configuration</strong> (see recap below): You only want to do this in rare occasions where you may have moved your b2evolution files or database to a different location...' => "<strong>Muutke oma baaskonfiguratsiooni</strong> (vaadake kokkuvõtet allpool): Teil on seda vaja teha ainult nendel haruldastel juhtudel, kui te liigutasite oma b2evolution faile või andmebaasi teise kohta...",
	'GO!' => "LÄKS!",
	'Need to start anew?' => "Tahate alustada uuesti?",
	'If you have installed b2evolution tables before and wish to start anew, you must delete the b2evolution tables before you can start a new installation. b2evolution can delete its own tables for you, but for obvious security reasons, this feature is disabled by default.' => "Kui te olete b2evolution tabelid ennem installinud ja soovite alustada uuesti, peate te kustutama b2evolution tabelid ennem kui saate alustada uut installatsiooni. b2evolution võib teie eest enda tabelid kustutada, kuid ilmselgetel turvalisuse põhjustel on see võimalus vaikimisi keelatud.",
	'Base config recap...' => "Põhikonfiguratsiooni kokkuvõte...",
	'If you don\'t see correct settings here, STOP before going any further, and <a %s>update your base configuration</a>.' => "Kui te ei näe korrektseid seadeid siin, PEATUGE enne edasiminekut ja <a %s>uuendage oma põhikonfiguratsiooni</a>.",
	'(Set, but not shown for security reasons)' => "(Olemas, kuid ei kuvata turvalisuse huvides)",
	'Admin email' => "Admin'i email",
	'Installing b2evolution tables with sample data' => "Installeerin b2evolution tabeleid näidisandmetega",
	'Installation successful!' => "Installatsioon õnnestus!",
	'<p>Now you can <a %s>log in</a> with the login "admin" and password "%s".</p>\n\t<p>Note that password carefully! It is a <em>random</em> password that is given to you when you install b2evolution. If you lose it, you will have to delete the database tables and re-install anew.</p>' => "<p>Nüüd saate te<a %s>sisse logida</a> login'iga \"admin\" ja parooliga \"%s\".</p>\n\t<p>Jälgige parooli hoolikalt! See on <em>juhuslik</em> parool, mis antakse teile kui te installeerite b2evolution. Kui te selle kaotate, peate te kustutama andmebaasi tabelid ja installima uuesi.</p>",
	'Upgrading data in existing b2evolution database' => "Uuendan andmeid olemasolevas b2evolution andmebaasis",
	'Upgrade completed successfully!' => "Uuendus lõpetatud edukalt!",
	'Now you can <a %s>log in</a> with your usual %s username and password.' => "Nüüd võite te <a %s>sisse logida</a> oma tavalise %s kasutajanime ja parooliga.",
	'Installing b2evolution tables and copying existing %s data' => "Installeerin b2evolution tabeleid ja kopeerin olemasolevaid %s andmeid",
	'<p>Now you can <a %s>log in</a> with your usual Miniblog email login cropped at 20 chars. All passwords have been reset to "%s".</p>\n<p>Note that password carefully! It is a <em>random</em> password that is given to you when you install b2evolution. If you lose it, you will have to delete the database tables and re-install anew.</p>' => "<p>Nüüd võite te <a %s>sisse logida</a> oma tavalisel Miniblog email login'iga, mis on piiratud 20 tähemärgi peale. Kõik paroolid on seatud \"%s\".</p>\n<p>Jälgige parooli hoolikalt! See on <em>juhuslik</em> parool, mis antakse teile kui te installeerite b2evolution. Kui te selle kaotate, peate te kustutama andmebaasi tabelid ja installima uuesi.</p>",
	'Deleting b2evolution tables from the datatase' => "Kustutan b2evolution tabelid andmebaasist",
	'For security reasons, the reset feature is disabled by default.' => "Turvapõhjustel on tühistamisfunktsioon vaikimisi keelatud.",
	'Reset done!' => "Tühistamine tehtud!",
	'Back to menu' => "Tagasi menüüsse",
	'official website' => "ametlik kodulehekülg",
	'contact' => "kontakt",
	'This blog holds all your posts upgraded from Cafelog. This blog is named \'%s\'. %s' => "See blog sisaldab endas kõiki teie postitusi, mis on uuendatud Cafelog'ist. Blog'i nimi on '%s'. %s",
	'This is a sample linkblog entry' => "See on linkblogi näidiskanne",
	'This is sample text describing the linkblog entry. In most cases however, you\'ll want to leave this blank, providing just a Title and an Url for your linkblog entries (favorite/related sites).' => "See on linkblogi kannet kirjeldav näidistekst. Üldjuhul on mõistlik jätta see tühjaks, jättes ainult Pealkirja ja Url teie linkblog'i kannete jaoks (lemmik/seotud leheküljed)",
	'This is the long description for the blog named \'%s\'. %s' => "See on blog'i '%s' pikk kirjeldus. %s",
	'This blog (blog #1) is actually a very special blog! It automatically aggregates all posts from all other blogs. This allows you to easily track everything that is posted on this system. You can hide this blog from the public by unchecking \'Include in public blog list\' in the blogs admin.' => "See blog (blog #1) on väga omapärane blog! Ta korjab endasse automaatselt kõik postitused kõikidest teistest blog'idest. See võimaldab teil kergesti jälgida kõike mis postitatakse selles süsteemis. Te saate peita selle blogi avalikkuse eest võttes maha märgistuse 'Sisaldub avalikus blog'ide nimekirjas' blog'i adminnis.",
	'%s Title' => "%s Pealkiri",
	'Tagline for %s' => "Märksõna %s jaoks",
	'Short description for %s' => "%s lühikirjeldus",
	'Notes for %s' => "%s märkmed",
	'Keywords for %s' => "%s võtmesõnad",
	'The main purpose for this blog is to be included as a side item to other blogs where it will display your favorite/related links.' => "Selle blog'i põhieesmärk on olla teiste blog'ide jaoks küljeühikuks, kus kuvatakse teie lemmik/seotud linke.",
	'Clean Permalinks!' => "Tühjenda püsilingid!",
	'b2evolution uses old-style permalinks and feedback links by default. This is to ensure maximum compatibility with various webserver configurations.\n\nNethertheless, once you feel comfortable with b2evolution, you should try activating clean permalinks in the Settings screen... (check \'Use extra-path info\')' => "b2evolution kasutab vaikimisi vana stiiliga püsilinke ja vastukaja. See on vajalik, et tagada maksimaalne ühilduvus erinevate veebiserveri konfiguratsioonidega.\n\nSellele vaatamata, kui te tunnete ennast b2evolution'iga mugavalt, peaksite te proovima aktiveerida puhtad püsilingid Seadete lehelt... (pange linnuke 'Kasuta ekstra-viite infot')",
	'Apache optimization...' => "Apache optimisatsioonid...",
	'In the <code>/blogs</code> folder as well as in <code>/blogs/admin</code> there are two files called [<code>sample.htaccess</code>]. You should try renaming those to [<code>.htaccess</code>].\n\nThis will optimize the way b2evolution is handled by the webserver (if you are using Apache). These files are not active by default because a few hosts would display an error right away when you try to use them. If this happens to you when you rename the files, just remove them and you\'ll be fine.' => "Kataloogides <code>/blogs</code> ja <code>/blogs/admin</code> on kaks faili nimega [<code>sample.htaccess</code>]. Te peaksite proovima neid ümber nimetada [<code>.htaccess</code>].\n\nSee optimiseerib b2evolutioni kasutamist veebiserveri poolt (kui te kasutate Apache't). Need failid ei ole vaikimisi aktiivsed kuna mõned host'id kuvavad koheselt peale nende kasutamist veateate. Kui see juhtub peale failide ümbernimetamist, eemaldage nad ja kõik saab korda.",
	'About evoSkins...' => "evoSkins kohta...",
	'By default, b2evolution blogs are displayed using a default skin.\n\nReaders can choose a new skin by using the skin switcher integrated in most skins.\n\nYou can change the default skin used for any blog by editing the blog parameters in the admin interface. You can also force the use of the default skin for everyone.\n\nOtherwise, you can restrict available skins by deleting some of them from the /blogs/skins folder. You can also create new skins by duplicating, renaming and customizing any existing skin folder.\n\nTo start customizing a skin, open its \'<code>_main.php</code>\' file in an editor and read the comments in there. And, of course, read the manual on evoSkins!' => "Vaikimisi b2evolution blog'id kuvatakse vaikimisi valitud skin'iga.\n\nLugejad võivad valida uue skin'i kasutades skin'ide vahetajat, mis on integreeritud enamustesse skin'idesse.\n\nTe võite muuta vaikimisi skin'i ükskõik mis blogi jaoks muutes blog'i parameetreid läbi admin'i interfeisi. Teil on ka võimalus sundida kõiki kasutama vaikimisi valitud skin'i.\n\nTeisalt võite te olemasolevate skin'ide valikut piirata kustutades ebavajalikud /blogs/skins kataloogist. Te võite ka uusi skin'e teha kopeerides kataloogi, selle nime muutes ja selle sisu redigeerides.\n\nSelleks, et muuta skin'i, tehke tema '<code>_main.php</code>' fail lahti redigeerijas ja lugege seesolevaid kommentaare. Ja muidugi, lugege käsiraamatut evoSkins lehel!",
	'Skins, Stubs and Templates...' => "Skin'id, kinnitused ja mallid...",
	'By default, all pre-installed blogs are displayed using a skin. (More on skins in another post.)\n\nThat means, blogs are accessed through \'<code>index.php</code>\', which loads default parameters from the database and then passes on the display job to a skin.\n\nAlternatively, if you don\'t want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided \'<code>a_stub.php</code>\' and call your blog through this stub instead of index.php .\n\nFinally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided \'<code>a_noskin.php</code>\'.\n\nYou will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.\n\nEither way, make sure you go to the blogs admin and set the correct access method for your blog. When using a stub or a template, you must also set its filename in the \'Stub name\' field. Otherwise, the permalinks will not function properly.' => "Vaikimisi kuvatakse kõiki eelinstalleritud blog'e kasutades skin'i. (Rohkem skin'idest järgmises postituses.)\n\nSee tähendab, et blog'idele pääsetase ligi läbi '<code>index.php</code>', mis laadib parameetrid andmebaasist ja seejärel annab edasi kuvamistöö skin'ile.\n\nAlternatiivina, kui te ei soovi kasutada DB vaikimisi parameetreid ja soovite, näiteks, peale suruda skin'i, kategooriat või spetsiifilist linkblog'i, võite te tekitada kinnitusfaili nagu äratoodud '<code>a_stub.php</code>' ja pöörduda oma blog'i poole läbi selle kinnituse index.php asemel.\n\nLõpetuseks, kui teil on vaja teha väga spetsiifilisi muudatusi oma blog'ile, võite te kasutada tühjasid malle skin'ide asemel. Sellisel juhul pöörduge oma blog'i poole läbi täismalli, nagu äratoodud '<code>a_noskin.php</code>'.\n\nTe leiate rohkem informatsiooni kinnitus/malli failidest. Avage nad tekstieditoris ja lugege neis leiduvaid kommentaare.\n\nKasutate ühte või teist meetodit, kontrollige kindlasti bolg'ide admin'ist, et te panite õige ligipääsumeetodi. Kui kasutate kinnitust või malli, peate te tema failinime panema 'Kinnituse nimi' lahtrisse. Kui te seda ei tee, siis permalingid ei tööta korralikult.",
	'Multiple Blogs, new blogs, old blogs...' => "Mitu Blog'i, uued blog'id, vanad blog'id...",
	'By default, b2evolution comes with 4 blogs, named \'Blog All\', \'Blog A\', \'Blog B\' and \'Linkblog\'.\n\nSome of these blogs have a special role. Read about it on the corresponding page.\n\nYou can create additional blogs or delete unwanted blogs from the blogs admin.' => "b2evolution tuleb vaikimisi 4 blog'iga, 'Blog All', 'Blog A', 'Blog B' ja 'Linkblog'.\n\nMõnedel nendest blog'idest on eriline roll. Lugege sellest vastaval leheküljel.\n\nTe võite lisada blog'e või kustutada soovimatuid blog'e blog'ide admin'ist.",
	'This is a multipage post' => "See on mitmeleheküljeline postitus",
	'This is page 1 of a multipage post.\n\nYou can see the other pages by cliking on the links below the text.\n\n<!--nextpage-->\n\nThis is page 2.\n\n<!--nextpage-->\n\nThis is page 3.\n\n<!--nextpage-->\n\nThis is page 4.\n\nIt is the last page.' => "See on lehekülg 1 mitmeleheküljelisest postitusest.\n\nTe võite näha teisi lehekülgi klikkides allpool teksti olevatel linkidel.\n\n<!--nextpage-->\n\nSee on lehekülg 2.\n\n<!--nextpage-->\n\nSee on lehekülg 3.\n\n<!--nextpage-->\n\nSee on lehekülg 4.\n\nSee on viimane lehekülg.",
	'Extended post with no teaser' => "Pikendatud postitus ilma sissejuhatuseta",
	'This is an extended post with no teaser. This means that you won\'t see this teaser any more when you click the "more" link.\n\n<!--more--><!--noteaser-->\n\nThis is the extended text. You only see it when you have clicked the "more" link.' => "See on pikendatud postitus ilma sissejuhatuseta. See tähendab seda, et te ei näe seda tutvustust peale seda, kui olete klikkinud \"more\" lingil.\n\n<!--more--><!--noteaser-->\n\nSee on pikendatud tekst. Te näete seda ainult peale seda, kui olete klikkinud \"more\" lingil.",
	'Extended post' => "Pikendatud postitus",
	'This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.\n\n<!--more-->\n\nThis is the extended text. You only see it when you have clicked the "more" link.' => "See on pikendatud postitus. See tähendab seda, et te näete ainult seda väikest sissejuhatust ja peate klikkima allpoololeval lingil, et ülejäänut näha.\n\n<!--more-->\n\nSee on pikendatud tekst. Seda näete ainult siis, kui olete klikkinud \"more\" lingil.",
	'Important information' => "Tähtis informatsioon",
	'Blog B contains a few posts in the \'b2evolution Tips\' category.\n\nAll these entries are designed to help you so, as EdB would say: "<em>read them all before you start hacking away!</em>" ;)\n\nIf you wish, you can delete these posts one by one after you have read them. You could also change their status to \'deprecated\' in order to visually keep track of what you have already read.' => "Blog B sisaldab mõndasid postitusi 'b2evolution Tips' kategoorias.\n\nKõik need sissekanded on mõeldud teie abistamiseks, või nagu EdB ütleks: \"<em>lugege neid ennem kui häkerdama hakkate!</em>\" ;)\n\nKui te soovite, võite kustutada need postitused ükshaaval peale seda kui olete nad läbi lugenud. Te võite ka muuta nende olekut 'ebasoovitud' selleks, et visuaalselt näha, mida te olete juba lugenud.",
	'First Post' => "Esimene postitus",
	'<p>This is the first post.</p>\n\n<p>It appears on both blog A and blog B.</p>' => "<p>See on esimene postitus.</p>\n\n<p>Seda on näha nii blog A's kui ka blog B's.</p>",
	'Second post' => "Teine postitus",
	'<p>This is the second post.</p>\n\n<p>It appears on blog A only but in multiple categories.</p>' => "<p>See on teine postitus.</p>\n\n<p>Seda on näha ainult blog A's aga mitmes kategoorias.</p>",
	'Third post' => "Kolmas postitus",
	'<p>This is the third post.</p>\n\n<p>It appears on blog B only and in a single category.</p>' => "<p>See on kolmas postitus.</p>\n\n<p>Seda on näha ainult blog B's ja ainukeses kategoorias.</p>",
	'Hi, this is a comment.<br />To delete a comment, just log in, and view the posts\' comments, there you will have the option to edit or delete them.' => "Tere, see on kommentaar.<br />Kommentaari kustutamiseks lihstalt logige sisse ja vaadake postituse kommentaare, seal on teil võimalus neid muuta või kustutada.",
